import React from 'react';
import { Link } from 'react-router-dom';
import img from "../images/footer/logo.png"

const Navbar = () => {
  return (
    <nav className="bg-[#EBCEA8] p-5 w-full absolute top-0 left-0 shadow-md z-50">
      <div className="container mx-auto flex justify-between items-center">
        {/* Logo Section */}
        <div className="text-lg font-bold text-black">
          <Link to="/" className="hover:text-gray-600">
          <img src={img} alt="Logo" className="w-[45%] ml-1r" />

          </Link>
        </div>
        
        {/* Navigation Links */}
        <div className="space-x-6 flex items-center">
          <Link to="/" className="hover:text-gray-600">
            Home
          </Link>
          <Link to="/about" className="hover:text-gray-600">
            About Us
          </Link>
          
          {/* Login Button */}
          <Link
            to="/login"
            className="text-black border  px-4 py-2 rounded-md hover:bg-gray-100"
            style={{ backgroundColor: "#FFFFFF" }}
          >
            Login
          </Link>
          
          {/* Register Button */}
          <Link
            to="/register"
            className="text-black px-4 py-2 rounded-md hover:opacity-90"
            style={{ backgroundColor: "#EB9721" }}
          >
            Register
          </Link>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
